import React from "react"
import DisplayDeck from "./DisplayDeck"

export default function deckList({activeDecks}){
    return (
        <div>
            {activeDecks.map((deck) => <DisplayDeck deckId={deck.deckId} deck={deck} />)}
        </div>
    )
}
